een mooie film

met de stemmen van Mike Myers, Cameron Diaz en Eddie Murphy

In plaats van het afschrikken van menig dorpsbewoner is Shrek (Mike Myers) inmiddels een echte familieman geworden. Shrek komt 
in contact met de gladde praatjesmaker Repelsteeltje. Hierdoor komt hij tot zijn schrik terecht in een alternatieve versie van 
zijn wereld, Far Far Away, waar er gejaagd wordt op Ogres en hij Fiona (Cameron Diaz) helemaal nooit ontmoet heeft. Aan hem de 
taak om zijn vertrouwde wereld weer terug te krijgen.
